import React from "react";

export const ContactPicker = ({contact, handleContactChange, value, name}) => {
  return (
    <>
      <select onChange={handleContactChange} value={value} name={name} >
        <option value="">No Contact Selected</option>
        {
          contact.map(contact => {
            <option value={contact.name}>{contact.name}</option>
          })
        }
      </select>
    </>
  );
};
